import { ConfigProvider, List, Typography, TypographyProps } from 'antd';

const { Title, Text } = Typography;

function SystemList() {
  const data = [
    'Công tyCP DVDL Phú Thọ',
    'Khu du lịch sinh thái Vàm Sát',
    'Khách sạn Ngọc Lan',
    'Khách sạn Phú Thọ',
    'Trung tâm Du Lịch Đầm Sen',
  ];
  const listC = {
    itemPadding: '0px',
  };
  return (<>
    <ConfigProvider theme={{
      components: {
        List: listC,
      },
    }}
    >
      <List
        dataSource={data}
        renderItem={(item) => (<List.Item>
          <Title level={5} className='text-white'><span></span>{item}</Title>
        </List.Item>)}
      />
    </ConfigProvider>
  </>);
}
export default SystemList;
